query.sparql:
PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  {
    SELECT ?lifespan WHERE {
      wd:Q174199 wdt:P4214 ?lifespan .
    }
    ORDER BY DESC(?lifespan)
    LIMIT 1
  }
  BIND(?lifespan AS ?dolphin_lifespan)

  {
    SELECT ?lifespan WHERE {
      wd:Q36341 wdt:P4214 ?lifespan .
    }
    ORDER BY DESC(?lifespan)
    LIMIT 1
  }
  BIND(?lifespan AS ?bear_lifespan)

  FILTER (?dolphin_lifespan > ?bear_lifespan)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
    { SELECT (COUNT(?countryEurope) AS ?countEurope) WHERE {
        ?countryEurope wdt:P30 wd:Q46 .
    }}
    { SELECT (COUNT(?countryAsia) AS ?countAsia) WHERE {
        ?countryAsia wdt:P30 wd:Q48 .
    }}
    FILTER(?countEurope > ?countAsia)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?answer WHERE {
  { SELECT (COUNT(?island) AS ?galapagos_count) WHERE { 
    ?island wdt:P361 wd:Q38095.
  }}
  { SELECT (COUNT(?island) AS ?hawaiian_count) WHERE {
    ?island wdt:P361 wd:Q192626.
  }}
  BIND(IF(?galapagos_count > ?hawaiian_count, "Galápagos Islands", "Hawaiian Islands") AS ?answer)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  { SELECT (COUNT(?deathDate1) AS ?count1)
    WHERE {
      wd:Q223390 wdt:P570 ?deathDate1 .
    }
  }
  {
   SELECT (COUNT(?deathDate2) AS ?count2)
    WHERE {
      wd:Q3244512 wdt:P570 ?deathDate2 .
    }
  }
  FILTER(?count1 > ?count2)
}
